test('makeAgoricNamesRemotesFromFakeStorage', t => {
  const fakeStorageKit = makeFakeStorageKit('');
  fakeStorageKit.data = new Map(agoricNamesDataEntriesFixture);
  const agoricNamesRemotes =
    makeAgoricNamesRemotesFromFakeStorage(fakeStorageKit);
  assert(agoricNamesRemotes.reverse);
  t.deepEqual(Object.keys(agoricNamesRemotes), [
    'brand',
    'instance',
    'reverse',
    'vbankAsset',
  ]);
  t.true(
    Object.keys(agoricNamesRemotes.reverse).every(k => k.startsWith('board0')),
  );
  for (const path of ['brand', 'instance']) {
    t.true(
      Object.values(agoricNamesRemotes[path]).every(v =>
        v.getBoardId().startsWith('board0'),
      ),
    );
  }
});

// XXX ses-ava can't test.macro
const toCapData = (t, specimen, expected) => {
  const marshaller = boardSlottingMarshaller();
  const actual = marshaller.toCapData(harden(specimen));
  t.deepEqual(actual, expected);
};

test('undefined', toCapData, undefined, { body: '#"#undefined"', slots: [] });
test('null', toCapData, undefined, { body: '#"#undefined"', slots: [] });
test('empty string', toCapData, '', { body: '#""', slots: [] });
test('bigint', toCapData, 123n, { body: '#"+123"', slots: [] });
test(
  'record',
  toCapData,
  { a: 1, b: 'str' },
  {
    body: '#{"a":1,"b":"str"}',
    slots: [],
  },
);

test('board ids', toCapData, Far('iface', { getBoardId: () => 'board123' }), {
  body: '#"$0.Alleged: iface"',
  slots: ['board123'],
});

test(
  'nested board ids',
  toCapData,
  {
    istBrand: Far('iface', { getBoardId: () => 'board123Ist' }),
    atomBrand: Far('iface', { getBoardId: () => 'board123Atom' }),
  },
  {
    body: '#{"atomBrand":"$0.Alleged: iface","istBrand":"$1.Alleged: iface"}',
    slots: ['board123Atom', 'board123Ist'],
  },
);
